close all;clear all;clc;
% warning off
tic
format long

HN_fine_mesh_data_F1

Nnode=length(dn(:,1));

Nelem=length(de(:,1));

nsorc=dat(1,3);% Number of sources
nmat=dat(1,4);% Number of materials
scale=dat(1,5);% Scale
jj=sqrt(-1);   %imaginary symbol

dn=dn*scale;

ncoil=16;
L=0.2;     % Length of coils (Z Direction) 20 cm
D=0;       % Width of coils (5.8) are negligible respect to their lengths
Turn=10;    % Turn in each coil

Acoil=(5*scale*30*scale);
magsorc=ds(:,2)./Acoil;
angsorc=pi/180*ds(:,3);



excit=sparse(ncoil,nmat);
mm=1;

for ic=1:ncoil
    for jc=1:2
        excit(ic,coil(ic,jc))=magsorc(mm)*cos(angsorc(mm))+jj*magsorc(mm)*sin(angsorc(mm));
        mm=mm+1;
    end
end


recivNode=zeros(ncoil,4);

vtxdomain=[66,65,80,79;87,82,104,95;107,98,129,113;131,115,137,123;141,127,138,124;136,122,130,114;128,112,106,97;103,94,86,81;77,78,63,64;57,61,39,50;36,45,14,30;12,28,6,20;2,16,5,19;7,21,13,29;15,31,37,46;40,51,58,62];
for i=1:ncoil
    for j=1:4
        recivNode(i,j)=vtx(find(vtx(:,1)==vtxdomain(i,j)),2);
    end
end

x_recivNode=zeros(size(recivNode));
y_recivNode=zeros(size(recivNode));
n_recivNode=zeros(2,64);

%plot receive nodes
% figure;
% hold on
% coun=0;
% for i1=1:ncoil
%     for j=1:4
%         coun=coun+1;
%         x_recivNode(i1,j)=dn(recivNode(i1,j),1);
%         y_recivNode(i1,j)=dn(recivNode(i1,j),2);
%         n_recivNode(1,coun)=dn(recivNode(i1,j),1);
%         n_recivNode(2,coun)=dn(recivNode(i1,j),2);
%         plot(x_recivNode(i1,j),y_recivNode(i1,j),'or')
%     end
% end
% 
% 
% figure

[a,  b , c , Area]=SeMatrix(dn,de);


K=sparse(Nnode,Nnode);

exper=0;                              %experiment counter



for ie=1:Nelem %{10}
    for m=1:3
        for n=1:3
            if m==n
                delta=1;
            else
                delta=0;
            end
            k(m,n)=(1/(4*Area(ie,1)))*(1/nu0)*((b(ie,m).*b(ie,n)+c(ie,n).*c(ie,m)))+(Area(ie,1)/12)*(1i*w*dm(de(ie,4),3))*(1+delta);
            K(de(ie,m),de(ie,n))=K(de(ie,m),de(ie,n))+k(m,n);
        end
    end
    
end %{10}
for ic=1:ncoil
    A=sparse(Nnode,1);
    B=sparse(Nnode,1);
    f(:,1)=sparse(excit(ic,de(:,4)));
    for ie=1:Nelem
        %f is a excitation source
        for m=1:3
            Be(ie,m)=Area(ie)*f(ie)/3;            %Be is a element excitation matrix
            B(de(ie,m),1)=B(de(ie,m),1)+Be(ie,m);
        end
    end
    Knew=(K);
    Bnew=(B);
    % Knew(nd,nd)=10^70.*eye(size(nd,2));
    % Bnew(nd)=10^70.*AT;
    
    Q=sparse(Nnode,1);  %Dirichlet Boundary Condition
    
    Knew(nd,:)=sparse(size(nd,2),size(Knew,2));
    Knew(:,nd)=sparse(size(Knew,2),size(nd,2));
    Knew(nd,nd)=eye(size(nd,2));
    Q(nd,1)=0;
    Bnew=B-K*Q;
    Bnew(nd)=Q(nd);
    
    A=Knew\Bnew;  %(photon density in FEM nodes)
    A=full(A);
    Aind(ic,:)=A.';%induction voltage vector for each excit
    for ir=ic+1:ncoil
        exper=exper+1;
        V_F1_NH(exper,1)=-jj*w*Turn*L*(mean([Aind(ic,(recivNode(ir,1))),Aind(ic,(recivNode(ir,2)))])-mean([Aind(ic,(recivNode(ir,3))),Aind(ic,(recivNode(ir,4)))]));%measuring voltages
        % warning: the sign must be minus!
        % it must be noted that the minuse sign in voltage calculation it is
        % for correction of receiving nodes direction. In fact receiving node 2
        % must be minus from receiving node 1.
    end
end

